#[test]
fn test_pow_mod_fermat_little_theorem() {
    // For prime modulus p and value a, a^(p-1) = 1 (mod p)
    let a: Field = 3;
    let p: Field = 11; // Prime
    // Safety: Test function calling unconstrained helper
    let result = unsafe { __pow_mod(a, p - 1, p) };
