#[test]
fn test_inv_mod_inverse_of_inverse() {
    let a: Field = 7;
    let m: Field = 11;
    // Safety: Test function calling unconstrained helper
    let inv_a = unsafe { __inv_mod(a, m) };
    // Safety: Test function calling unconstrained helper
    let inv_inv_a = unsafe { __inv_mod(inv_a, m) };
