    // Verify: result * b = a (mod m)
    // Safety: Test function calling unconstrained helper
    let (_, a_reduced) = unsafe { __compute_mod_reduction(a, m) }; // 250 mod 97 = 56
    // Safety: Test function calling unconstrained helper
    assert(unsafe { __mul_mod(result, b, m) } == a_reduced);
}

#[test]
