fn test_consecutive_absorb_aggregation() {
    // Test that consecutive ABSORB operations are properly aggregated
    // Pattern: ABSORB(1), ABSORB(1), SQUEEZE(1) should aggregate to ABSORB(2), SQUEEZE(1)
    let domain_separator = [
